Basurdea (Sus scrofa) mammalia klaseko eta suidae familiako ugaztuna da. 90-150 cm inguru neurtzera irits daiteke eta 80 kg inguruko pisua pisatzera. Ia mundu osoan zabalduta dagoen ugaztun horirek txerriaren antza handia dauka. Espeziea leku batzuetan galduta dago, gizakiak hil duelako –adibidez, Britainiar Uharteetan. Beste batzuetan, aldiz, gizakiak berak eraman du, hala nola, Ameriketara eta Ozeaniara. Gehienak Afrikako iparraldean, Europan eta Asian bizi dira. Ingurune guztietan bizi da, baldin eta basoak badaude; horiek beharrezkoak ditu, eguna gordeta igarotzeko. Sus scrofa animaliak azpiespezieok ditu: 
* Sus scrofa domesticus, txerria; 
* Sus scrofa scrofa, Mendebaldeko Afrika eta Europa; 
* Sus scrofa ussuricus, Iparraldeko Asia eta Japonia; 
* Sus scrofa cristatus, Hegoaldeko Asia eta India; 
* Sus scrofa vittatus, Indonesia.
